import React, { Component } from "react";
let stars = [];
let star = " * ";

function starfill() {
  for (let i = 0; i < 5000; i++) {
    setTimeout(function timer() {
      stars.push(star);
      console.log(stars);
    }, i * 300);
  }
}

starfill();

export default class Starback extends Component {
  componentDidMount() {}
  render() {
    return (
      <div>
        <h2>hello calle</h2>
        <div className="stars">{stars}</div>
      </div>
    );
  }
}
